import './App.css';
import NavBar from './components/NavBar/NavBar';
import Home from './Pages/Home/Home';

import Footer from './components/Footer/Footer';
import { Routes, Route } from 'react-router';
import React from "react";


function App() {
  return (
    <div className="App">

      <NavBar />
      <div>
        <Routes>
          <Home />
        </Routes>
      </div>
      <Footer />
    </div>
  );
}

export default App;
